'use client';
import { ErrorSummaryRoot } from './ErrorSummaryRoot.js';
import { ErrorSummaryHeading } from './ErrorSummaryHeading.js';
import { ErrorSummaryItem } from './ErrorSummaryItem.js';
import ErrorSummaryList from './ErrorSummaryList.js';

const ErrorSummary = {};
ErrorSummary.Root = ErrorSummaryRoot;
ErrorSummary.Item = ErrorSummaryItem;
ErrorSummary.Heading = ErrorSummaryHeading;
ErrorSummary.List = ErrorSummaryList;
ErrorSummary.Root.displayName = 'ErrorSummary.Root';
ErrorSummary.Item.displayName = 'ErrorSummary.Item';
ErrorSummary.Heading.displayName = 'ErrorSummary.Heading';
ErrorSummary.List.displayName = 'ErrorSummary.List';

export { ErrorSummary, ErrorSummaryHeading, ErrorSummaryItem, ErrorSummaryList, ErrorSummaryRoot };
